1487. Inquisitor Heinrich Kramer finishes work on &quot;Hammer of Witches&quot; - a book that is destined to become the most famous medieval treatise on demonology. Some believe theologian loyal servant of the church, others - a bloodthirsty charlatan. He himself, without regard to the opinion of the crowd, sent to administer God's judgments in town Valdershtadt, where he will fight the Red Queen. Cramer mission - to destroy the evil sorceress goal - to get &quot;Witches Hammer&quot;. Mortal Kombat begin!

